webpackJsonp([0xed095fa075df],{1138:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/feeling-smart-try-googles-code-jam/index.md absPath of file >>> MarkdownRemark",html:'<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/codejam-726e1d5ca6e9d248494112d46207c436-e8574.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="codejam"\n        title=""\n        src="/static/codejam-726e1d5ca6e9d248494112d46207c436-e8574.jpg"\n        srcset="/static/codejam-726e1d5ca6e9d248494112d46207c436-c94d9.jpg 158w,\n/static/codejam-726e1d5ca6e9d248494112d46207c436-9885b.jpg 315w,\n/static/codejam-726e1d5ca6e9d248494112d46207c436-e8574.jpg 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Google Code Jam is a pretty much a coding competition.  You can use any programming language you like, they\'ll give you a problem, and you have to solve it.  Sound fun?  Well, you have between four and eight minutes to submit your answers, and you\'ll get three to six problems per round.  Still sound like fun?</p>\n<p>Well, the 24 hr Qualification Round Begins on Wednesday July 16th, and you can <a href="http://code.google.com/codejam/contest/registration">register here</a>.</p>\n<p>I think I\'m going to attempt the qualification round, but I have no illusions about the accuracy of my speed-coding.  The guys at Google wouldn\'t make things too difficult - would they?</p>',frontmatter:{title:"Feeling smart? Try Google's Code Jam",date:"July 01, 2008",tags:["code-jam","competitions","google"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/adobe-air-gets-serious/",tags:null,title:"Adobe AIR gets serious?",image:null,date:"2008-06-18T22:01:16.000Z"}},next:{frontmatter:{path:"/blog/stop-using-mxtransitionstween/",tags:["flash","actionscript"],title:"Stop using mx.transitions.Tween;",image:null,date:"2008-07-12T16:15:16.000Z"}}}}}});
